import React from "react";
import StudentListItem from "./StudentListItem";
import Dropdown from "react-dropdown";
import "react-dropdown/style.css";

class StudentList extends React.Component {
  render() {
    const { items } = this.props;
    const names = items.map((item) => item.name);
    const uniquenames = [...new Set(names)];
    const listOfStudents = uniquenames
      ? uniquenames.map((uniquename) => (
          <StudentListItem
            key={uniquename}
            item={uniquename}
          ></StudentListItem>
        ))
      : "";

    const defaultOption = listOfStudents[0];
    const studentRouting = props.names.map(name => {
      return(
          <Route path={`/StudentEvaluat/${name}`} key={name}>
            <StudentPage name={name} data={props.data}/>
          </Route>
      )
    })
    return (
      <div>
        <Dropdown
          options={listOfStudents}
          onChange={this._onSelect}
          value={defaultOption}
          placeholder="Select a student"
        />
      </div>
    );
  }
}

export default StudentList;
